column8:
ネジ1本の重さまで突き詰めた、約30gの超軽量設計。 建築で用いられるトラス構造をもとに設計し、マウス全体の強度維持しつつ軽量化を実現したワイヤレスBluetooth(R)マウス“EGG MOUSE FREE”。<br />ネジ1本の重さまで突き詰め、電池を含めた重さが約30gという驚異の超軽量を実現したワイヤレスBluetooth(R)マウス“EGG MOUSE FREE”です。<br />
建築で用いられるトラス構造をもとに設計し、マウス全体の強度を維持しながら軽量化を実現しています。<br />
軽い力で操作することができるので、長時間の使用でも疲れにくく、手に優しい設計です。<br />
耐久性の面で信頼性が高く、クリック感にも定評があるOMRON社製スイッチを採用しています。<br />
消費電力の小さな、赤外線LED(IR LED)を搭載しています。<br />
繰り返し充電可能なリチウムイオン電池を搭載しており、1回の満充電で約2ヶ月使用することができます。<br />
スムーズで快適な操作を実現する分解能1800カウントです。<br />
Bluetooth(R)3.0規格に適合しており、Bluetooth(R)HIDプロファイルに対応したパソコンであれば、レシーバを接続することなくスマートにマウスを使用できます。<br />
※Bluetooth(R)HIDプロファイルに対応していないパソコンでも、規格に適合したBluetooth(R)アダプタを用意することで使用可能です。 (推奨Bluetoothアダプタ:LBT-UAN05C2(別売))<br />
非磁性体で約10m、スチールデスクなど磁性体の上でも約3mの距離まで使用できます。(当社調べ)<br />
本体裏面に電源スイッチがあり、不使用時の電池の消耗を防止できます。<br />
電池の交換時期をお知らせする電池残量表示ランプを搭載しています。<br />●対応機種:Bluetooth(R)HIDプロファイルに対応したWindowsパソコン、Macintosh<br />
●対応OS:Windows 10、Windows RT8.1、Windows 8.1、Windows 7、Windows Vista 、Windows XP、macOS Sierra(10.12) ※各OSの最新バージョンへのアップデートや、サービスパックのインストールが必要になる場合があります。<br />
●適合規格:Bluetooth 3.0 Class2 / プロファイル:HID(Human Interface Device)<br />
●分解能:1800カウント<br />
●通信方式:FHSS方式<br />
●電波周波数:2.4GHz帯<br />
●電波到達距離:磁性体(鉄の机など)の上で使用する場合:3m、非磁性体(木の机など)の上で使用する場合:10m<br />
●読取り方式:光学センサー方式<br />
●射出光線種類:不可視波長域<br />
●ボタン数:3個 ※ホイールボタン含む<br />
●ホイール数:1個<br />
●連続動作時間:約33時間<br />
●連続待機時間:約60日<br />
●想定電池使用期間:約57日<br />
●電源(本体):内蔵リチウムイオン充電池<br />
●カラー:ブラック<br />
●外形寸法(マウス本体):幅65.0×奥行86.0×高さ38.4mm<br />
●サイズ分類:Sサイズ<br />
●質量(マウス本体):約30g<br />
●付属品:充電用ケーブル[USB A⇔micro-B](ケーブル長:約15cm)×1、ユーザーズマニュアル×1<br />
●保証期間:6カ月<style type="text/css">





